// SPDX-License-Identifier: MIT

pragma solidity >=0.6.12;

import "./LendingContract.sol";
import "./interfaces/IRouter.sol";
import "./interfaces/IPositionRouter.sol";
import "./interfaces/IOrderBook.sol";
import "./libraries/SafeMath.sol";

contract AbstractPosition {
    struct Position {
        uint256 size;
        uint256 collateral;
        uint256 averagePrice;
        uint256 entryFundingRate;
        uint256 reserveAmount;
        uint256 realisedPnl;
        uint256 lastIncreasedTime;
    }

    using SafeMath for uint256;

    uint256 public constant PRICE_PRECISION = 10 ** 30;

    // addresses
    address public gov;
    address public lendingContractAddress;

    // gmx contracts
    address public positionRouterAddress;
    address public routerAddress;
    address public orderBookAddress;

    address public ownerAddress;

    uint256 public minExecutionFee;

    mapping(bytes32 => uint256) public orderIndexMap;
    uint public decreaseOrderIndex;

    constructor(
        address _gov,
        address _lendingContractAddress,
        address _ownerAddress,
        address _positionRouterAddress,
        address _routerAddress,
        address _orderBookAddress
    ) {
        // init state variables
        gov = _gov;
        ownerAddress = _ownerAddress;
        lendingContractAddress = _lendingContractAddress;

        positionRouterAddress = _positionRouterAddress;
        routerAddress = _routerAddress;
        orderBookAddress = _orderBookAddress;

        // approve position router address for router for smartcontract address
        IRouter router = IRouter(_routerAddress);
        router.approvePlugin(positionRouterAddress);
    }

    // update the positionRouter address, maybe GMX positionRouter address changes
    function setLendingContractAddress(address _lendingContractAddress) external {
        _onlyGov();
        lendingContractAddress = _lendingContractAddress;
    }

    // update the positionRouter address, maybe GMX positionRouter address changes
    function setPositionRouterAddress(address newAddress) external {
        _onlyGov();
        positionRouterAddress = newAddress;
    }

    // update the router address, maybe GMX router address changes
    function setRouterAddress(address newAddress) external {
        _onlyGov();
        routerAddress = newAddress;
    }

    // set min execution fee for setting stop loss
    function setMinExecutionFee(uint256 _minExecutionFee) public {
        _onlyGov();
        minExecutionFee = _minExecutionFee;
    }

    // user calls this function when user wants to:
    // 1. opens a long or short position
    // 2. increase collateral for an existing position
    function callCreateIncreasePosition(
        address[] memory _path,
        address _indexToken,
        uint256 _minOut,
        uint256 _sizeDelta,
        bool _isLong,
        uint256 _acceptablePrice,
        uint256 _executionFee,
        bytes32 _referralCode,
        address _callbackTarget
    ) external payable returns (bytes32) {
        // validate weather the function is called by the owner of this smart contract
        require(msg.sender == ownerAddress, "only the owner can call this function");

        // call GMX smart contract to create increase position
        IPositionRouter positionRouter = IPositionRouter(positionRouterAddress);
        return
            positionRouter.createIncreasePositionETH{value: msg.value}(
                _path,
                _indexToken,
                _minOut,
                _sizeDelta,
                _isLong,
                _acceptablePrice,
                _executionFee,
                _referralCode,
                _callbackTarget
            );
    }

    // user calls this function when user wants to:
    // 1. closes a long or short position
    // 2. decrease collateral for an existing position
    function callCreateDecreasePosition(
        address[] memory _path,
        address _indexToken,
        uint256 _collateralDelta,
        uint256 _sizeDelta,
        bool _isLong,
        address _receiver,
        uint256 _acceptablePrice,
        uint256 _minOut,
        uint256 _executionFee,
        bool _withdrawETH,
        address _callbackTarget
    ) external payable returns (bytes32) {
        // validate weather the function is called by the owner of this smart contract
        require(msg.sender == ownerAddress || msg.sender == lendingContractAddress, "only the owner or gov can call this function");
        require(msg.value > _executionFee, "myval");

        // allow to decrease position of non loaned assets
        require(LendingContract(lendingContractAddress).existingLoanOnPosition(ownerAddress, _indexToken, _isLong) == 0, "can't liquidateposition as there is an existing loan");

        // call GMX smart contract to create decrease position
        return
            IPositionRouter(positionRouterAddress).createDecreasePosition{value: msg.value}(
                _path,
                _indexToken,
                _collateralDelta,
                _sizeDelta,
                _isLong,
                _receiver,
                _acceptablePrice,
                _minOut,
                _executionFee,
                _withdrawETH,
                _callbackTarget
            );
    }

    function createOrUpdateDecreaseOrder(
        address _indexToken,
        address _collateralToken,
        bool _isLong,
        uint256 _loanAmount,
        uint256 _collateral,
        uint256 _averagePrice,
        uint256 _size    
    ) public {
        require(msg.sender == lendingContractAddress, "only lendingContract can call this function");

        // calculate trigger price
        uint256 _triggerPrice = triggerPrice(_size, _loanAmount, _collateral, _averagePrice);

        IOrderBook orderBook = IOrderBook(orderBookAddress);
        // update order index for the (indexToken, isLong) pairs
        if (orderIndexMap[_getOrderKey(_indexToken, _isLong)] != 0) {
            decreaseOrderIndex = decreaseOrderIndex.add(1);
            orderIndexMap[_getOrderKey(_indexToken, _isLong)] = decreaseOrderIndex;

            // create a stop loss on GMX's order book contract
            orderBook.createDecreaseOrder{value: minExecutionFee}(_indexToken, _size, _collateralToken, _collateral, _isLong, _triggerPrice, !_isLong);
        } else {
            orderBook.updateDecreaseOrder(orderIndexMap[_getOrderKey(_indexToken, _isLong)], _collateral, _size, _triggerPrice, !_isLong);
        }

    }

    function cancelDecreaseOrder(address _indexToken, bool _isLong) public {
        require(msg.sender == lendingContractAddress, "only lendingContract can call this function");

        // cancel decrease order
        IOrderBook orderBook = IOrderBook(orderBookAddress);
        orderBook.cancelDecreaseOrder(orderIndexMap[_getOrderKey(_indexToken, _isLong)] - 1);
    }

    function _getOrderKey(address _indexToken, bool _isLong) private pure returns (bytes32) {
        return keccak256(abi.encodePacked(_indexToken, _isLong));
    }

    function triggerPrice(uint256 _size, uint256 _loanAmount, uint256 _collateral, uint256 _averagePrice) public pure returns(uint256) {
        uint256 _borrowedWithMargin = _size.div(100).add(_loanAmount);
        if (_borrowedWithMargin > _collateral) {
            return _borrowedWithMargin.sub(_collateral).div(_size).mul(_averagePrice).add(_averagePrice).mul(100).div(99);
        } else {
            uint256 term1 = _collateral.sub(_borrowedWithMargin).div(_size).mul(_averagePrice);
            return _averagePrice.sub(term1).mul(100).div(99);
        }
    }

    // allow only the governing body to run function
    function _onlyGov() private view {
        require(msg.sender == gov, "only gov can call this function");
    }

    // this function will be removed after testing.
    function deposit() payable external {
        // deposit sizes are restricted to 1 ether
        require(msg.value == 1 ether);
    }
}

