contracts/LendingContract.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.6.12;

import "./interfaces/IVault.sol";
import "./AbstractPosition.sol";
import "./FactoryContract.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract LendingContract {
    struct Position {
        uint256 size;
        uint256 collateral;
        uint256 averagePrice;
        uint256 entryFundingRate;
        uint256 reserveAmount;
        uint256 realisedPnl;
        uint256 lastIncreasedTime;
        uint256 maxLoanAmount;
    }

    uint256 public constant PRICE_PRECISION = 10 ** 30;

    address public gov;
    address public factoryContractAddress;
    address public vaultContractAddress;

    address public usdcAddress;

    mapping(bytes32 => uint256) public amountLoanedForPosition;
    uint256 public totalLoanedAmount = 0;

    constructor(address _vaultContractAddress, address _usdcAddress) {
        gov = msg.sender;

        vaultContractAddress = _vaultContractAddress;
        usdcAddress = _usdcAddress;
    }

    // set the factory contract address
    function setFactoryaContractAddress(address newAddress) external {
        _onlyGov();
        factoryContractAddress = newAddress;
    }

    // set the vault contract(GMX) address
    function setVaultContractAddress(address newAddress) external {
        _onlyGov();
        vaultContractAddress = newAddress;
    }

    // function for liquidity providers to add liquidity to the pool
    // we might have to create something like a router contract to handle this.
    function provideLiquidity(
        uint256 _amount
    ) external returns (uint256 availablePool) {
        ERC20(usdcAddress).transferFrom(msg.sender, address(this), _amount);

        // todo: transfer our native tokens as holding value of LP provider

        return ERC20(usdcAddress).balanceOf(address(this));
    }

    // returns the usdc reserves
    function getReserve() public view returns (uint256) {
        return IERC20(usdcAddress).balanceOf(address(this));
    }

    // the position as on the GMX contract
    function getPosition(
        address _account,
        address _indexToken,
        bool _isLong
    ) public view returns (uint256, uint256, uint256, uint256, uint256, uint256, uint256, uint256) {
        Position memory position;
        (
            position.size,
            position.collateral,
            position.averagePrice,
            ,
            ,
            ,
            ,
            position.lastIncreasedTime
        ) = IVault(vaultContractAddress).getPosition(_account, _indexToken, _indexToken, _isLong);

        position.maxLoanAmount = maxLoan(_indexToken, position.size, position.averagePrice, position.collateral, position.lastIncreasedTime, _isLong);

        return (
            position.size,
            position.collateral,
            position.averagePrice,
            position.entryFundingRate,
            position.reserveAmount,
            position.realisedPnl,
            position.lastIncreasedTime,
            position.maxLoanAmount
        );
    }

    function maxLoan(address _indexToken, uint256 _positionSize, uint256 _positionAveragePrice, uint256 _positionCollateral, uint256 _positionLastIncreasedTime, bool _isLong) public view returns(uint256) {
        (bool _hasProfit, uint256 delta) = IVault(vaultContractAddress).getDelta(
            _indexToken,
            _positionSize,
            _positionAveragePrice,
            _isLong,
            _positionLastIncreasedTime
        );

        if (_hasProfit) {
            return (((_positionCollateral + delta) * 80) / 100);
        } else {
            return (((_positionCollateral - delta) * 80) / 100);
        }
    }

    // function to take loan on position
    function takeLoanOnPosition(
        address _indexToken,
        bool _isLong,
        uint256 _loanAmount
    ) external {
        // existing loan on position
        uint256 _amountLoanedForPosition = existingLoanOnPosition(msg.sender, _indexToken, _isLong);

        // fetch abstract position address for msg.sender
        FactoryContract factoryContract = FactoryContract(factoryContractAddress);
        address abstractPositionAddress = factoryContract.getContractForAccount(msg.sender);


        // get position for the borrower against their abstract position address
        Position memory position;
        (
            position.size,
            position.collateral,
            position.averagePrice,
            ,
            ,
            ,
            ,
            position.maxLoanAmount
        ) = getPosition(abstractPositionAddress, _indexToken, _isLong);

        // total loan amount can't exceed maximum loan amount
        require(position.maxLoanAmount > _loanAmount + _amountLoanedForPosition, "insufficiant collateral");

        // create or update the stop loss on GMX using abstract position contract
        AbstractPosition abstractPositionContract = AbstractPosition(abstractPositionAddress);
        abstractPositionContract.createOrUpdateDecreaseOrder(
            _indexToken,
            _indexToken,
            _isLong,
            _loanAmount + _amountLoanedForPosition,
            position.collateral,
            position.averagePrice,
            position.size
        );

        // update total loaned amount
        totalLoanedAmount += _loanAmount;

        // update loaned amount on given position
        amountLoanedForPosition[_getLoanAmountKey(msg.sender, _indexToken, _isLong)] = _amountLoanedForPosition + _loanAmount;

        // transfer the loan amount borrower
        ERC20(usdcAddress).transfer(msg.sender, _loanAmount);
    }

    function paybackLoan(
        address _indexToken,
        bool _isLong,
        uint256 _repayLoanAmount
    ) external {
        // existing loan on position
        uint256 _amountLoanedForPosition = existingLoanOnPosition(msg.sender, _indexToken, _isLong);

        // fetch abstract position address for msg.sender
        FactoryContract factoryContract = FactoryContract(factoryContractAddress);
        address abstractPositionAddress = factoryContract.getContractForAccount(msg.sender);

        AbstractPosition abstractPosition = AbstractPosition(abstractPositionAddress);

        // transfer loan amount to the lending contract address
        ERC20(usdcAddress).transferFrom(msg.sender, address(this), _amountLoanedForPosition);

        // decrease the loan amount paid back
        amountLoanedForPosition[_getLoanAmountKey(msg.sender, _indexToken, _isLong)] = _amountLoanedForPosition - _repayLoanAmount;

        // if total loan is repayed cancel position or update the trigger price for the stop loss.
        if (_amountLoanedForPosition == _repayLoanAmount) {
            abstractPosition.cancelDecreaseOrder(_indexToken, _isLong);
        } else {
            // get position for the borrower against their abstract position address
            Position memory position;
            (
                position.size,
                position.collateral,
                position.averagePrice,
                ,
                ,
                ,
                ,
                position.maxLoanAmount
            ) = getPosition(abstractPositionAddress, _indexToken, _isLong);

            // total loan amount can't exceed maximum loan amount
            require(_repayLoanAmount < _amountLoanedForPosition, "insufficiant collateral");

            // update the stop loss on GMX using abstract position contract
            AbstractPosition abstractPositionContract = AbstractPosition(abstractPositionAddress);
            abstractPositionContract.createOrUpdateDecreaseOrder(
                _indexToken,
                _indexToken,
                _isLong,
                _amountLoanedForPosition- _repayLoanAmount ,
                position.collateral,
                position.averagePrice,
                position.size
            );

            // update total loaned amount
            totalLoanedAmount -= _repayLoanAmount;

            // update loaned amount on given position
            amountLoanedForPosition[_getLoanAmountKey(msg.sender, _indexToken, _isLong)] = _amountLoanedForPosition - _repayLoanAmount;
        }

        return;
    }

    function existingLoanOnPosition (address _account, address _indexToken, bool _isLong) public view returns(uint256) {
        return amountLoanedForPosition[
            _getLoanAmountKey(_account, _indexToken, _isLong)
        ];
    }

    function _getLoanAmountKey(
        address _account,
        address _indexToken,
        bool _isLong
    ) private pure returns (bytes32) {
        return keccak256(abi.encodePacked(_account, _indexToken, _isLong));
    }

    // allow only the governing body to run function
    function _onlyGov() private view {
        require(msg.sender == gov, "only gov can call this function");
    }
}

